import React from "react";

export default class StatefulGreeting extends React.Component {

constructor(props) {
  super(props)
  this.state = {
    introduction : "Hello",
    buttonText : "Exit",
  };
}

render() {
  return (
  <div>
  <h1>Hello {this.props.greeting} welcome to our website</h1>
  <button></button>
  </div>
  )
}

}
